import React, {useContext} from 'react'
import {GlobalState} from '../../../GlobalState'

function Profile() {
    const state = useContext(GlobalState)
    const [userId] = state.userAPI.userId
    return (
        <>
            <div>
                Profile
            </div>
            console.log(userId)
        </>
    )
}

export default Profile
